import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Use getByRole to find the "Your Profile" link and click it.
    // Since multiple links with the same name exist, we select the first one.
    const profileLink = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    // Wait for the profile section to be visible after the click
    await page.waitForSelector('.profile-page', { state: 'visible', timeout: 5000 });

    // Take a screenshot after navigating to the profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract data from the profile page to verify the action
    const profileName = await page.locator('.profile-info h2').textContent();
    const profileUsername = await page.locator('.profile-info .username').textContent();

    const extractedData = {
      profileName: profileName.trim(),
      profileUsername: profileUsername.trim()
    };

    return {
      success: true,
      action: "Successfully navigated to Jun's Profile by clicking the 'Your Profile' link.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
